import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Data_Admin = () => {
  const [data, setData] = useState([]);
  const [editingItem, setEditingItem] = useState(null);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = () => {
    axios.get('http://localhost:8000/api/data')
      .then(response => {
        setData(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  };

  const handleInputChange = (e, item) => {
    setEditingItem({ ...item, [e.target.name]: e.target.value });
  };

  const updateItem = (item) => {
    axios.put(`http://localhost:8000/api/data/${item._id}`, item)
      .then(response => {
        setEditingItem(null);
        fetchData();
      })
      .catch(error => {
        console.error(error);
      });
  };

  const renderData = () => {
    return (
      <table>
        <thead>
          <tr>
            <th>Title</th>
            <th>Author's First Name</th>
            <th>Author's Last Name</th>
            <th>Author's Birth</th>
            <th>Price</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {data.map(item => (
            <tr key={item._id}>
              <td>{item.title}</td>
              <td>
                {item.author && item.author.firstname}
              </td>
              <td>
                {item.author && item.author.lastname}
              </td>
              <td>
                {item.author && item.author.dateofbirth}
              </td>
              <td>{item.price}</td>
              <td>
                {editingItem && editingItem._id === item._id ? (
                  <>
                    <input
                      type="text"
                      name="title"
                      value={editingItem.title}
                      onChange={(e) => handleInputChange(e, editingItem)}
                    />
                    <input
                      type="text"
                      name="firstname"
                      value={editingItem.author ? editingItem.author.firstname : ''}
                      onChange={(e) => handleInputChange(e, editingItem)}
                    />
                    <input
                      type="text"
                      name="lastname"
                      value={editingItem.author ? editingItem.author.lastname : ''}
                      onChange={(e) => handleInputChange(e, editingItem)}
                    />
                    <input
                      type="text"
                      name="dateofbirth"
                      value={editingItem.author ? editingItem.author.dateofbirth : ''}
                      onChange={(e) => handleInputChange(e, editingItem)}
                    />
                    <input
                      type="text"
                      name="price"
                      value={editingItem.price}
                      onChange={(e) => handleInputChange(e, editingItem)}
                    />
                    <button onClick={() => updateItem(editingItem)}>Save</button>
                    <button onClick={() => setEditingItem(null)}>Cancel</button>
                  </>
                ) : (
                  <button onClick={() => setEditingItem(item)}>Edit</button>
                )}
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    );
  };

  return (
    <div>
      <h1>Data Admin</h1>
      {renderData()}
    </div>
  );
};

export default Data_Admin;
